import React, { Component } from 'react';

class AddEntry extends Component {
    constructor(props){
        super(props)

        this.state = {
            title:'',
            year: '',
            author: '',
            images: []
        }

    }

    render() {
        return(
            <h1> Add entry form here</h1>
        )
    }
}

export default AddEntry;
